generated.css:
@font-face{
    font-family: RobotoCondensed;
    src: url(70d9ef85b6126a53f0f50dcddc1ca484.ttf);
    font-weight: 800;
}

@font-face{
    font-family: EconomicaBold;
    src: url(99a625ea635a28cce04e8e494b753017.ttf);
}


body{
    text-align: center;
    font-size: 20px;
    padding: 2.5%;
    background-color: whitesmoke;
    /* font-family: 'Roboto Condensed', sans-serif; */
    font-family: 'RoboRobotoCondensedto';
}

h1, h2, h3, h4, h5{
    font-family: 'EconomicaBold';
}

.track{
    width: 250px;
    height: 250px;
    position: relative;
    display: inline-block;
    margin: 20px;
    cursor: pointer;
}

.track-image{
    width: 250px;
    height: 250px;
}

.track-text{
    position: absolute;
    width: 250px;
    bottom: 0px;
    background-color: rgba(0, 0, 0,0.5);
    color: white;
    padding: 5px;
}

.track-icon{
    position: absolute;
    bottom: 100px;
    left: 100px;
    color: white;
    background-color: black;
    width: 50px;
    height: 50px;
    border-radius: 25px;
    padding: 10px;
    opacity: 0.8;
}
